import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "./css/BooksCategory.css";
import { Link } from "react-router-dom";
import axios from "axios";

const bookForDownload = props => {
    return (
        <div class="card col-div-books-category" style={{ width: "18rem" }}>
            <img class="card-img-top" src=".../100px180/?text=Image cap" alt="Card image cap" />
            <div class="card-body">
                <h5 class="card-title">Card title</h5>
                    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
            </div>
            <div class="card-body">
            <Link to="#" class="card-link">
                <button className="btn btn-primary">Download</button>
            </Link>
            </div>
        </div>
    )
}

export default class books extends Component {
    constructor(props) {
        super(props);
        this.componentDidMount = this.componentDidMount.bind(this)
        this.printData = this.printData.bind(this);
        this.state = {
            data: [],
        }
    }
    componentDidMount() {
        axios.get("http://localhost:5000/exercise/").then(res => {
            console.log(this.props.match.params.name);
            this.setState({
                data: res.data.users
            })
        });
    }
    exerciseList() {
        return this.state.data.map(currentExercise => {
            return <bookForDownload file={currentExercise.path} pdfFile={currentExercise.pathPdf} key={currentExercise._id} id={currentExercise._id} exercise={currentExercise} deleteExercise={this.deleteExcercise} />
        })
    }
    render() {
        return (
            <div className="row row-div-Books-category">
                {this.printData()}
                
            </div>

        )

    }
}
